import React, { Component } from "react";
import { Switch, Router } from "react-router-dom";
import LandingPage from "./landingPage.js";
const Main = () => {
  return (
    <Switch>
      <Route exact path="/" component={LandingPage} />
    </Switch>
  );
};

export default Main;
